import React from "react";
import "./home.css";
export default function home() {
  return (
    <div className="home p-5">
      <img
        src="./logo-2.jpeg"
        alt=""
        className="w-36 h-36 absolute left-10 top-10"
      />
      <div className="w-screen h-screen bg-transparent flex p-2">
        <div className=" bg-transparent flex items-center justify-center flex-col ">
          <div className="  p-5 font-bold text-xl   rounded-md flex  space-x-10 flex-wrap "></div>
        </div>
        <div className="w-8/12 bg-black"></div>
      </div>
    </div>
  );
}

