          src={src}
          alt=""
          srcset=""
          className="inline-block h-16 w-16 rounded-full ring-2 object-cover ring-white"
        />
        <h6 class="font-bold text-sm mt-2 text-slate-900">Elon Musk</h6>
        <h6 class="font-semibold text-xs text-slate-900">Cheaf Editor</h6>
      </div>
    </div>
  );
}
